			     		<Banner/>
			     	</div>

			     	<div style={{paddingTop:'16px'}} className='container-fluid' >
			     	<div className='row'>
				     	<div className='col-3'>
				     		<Filter/>
				     	</div>

				     	<div className='col-9'>
				     		<Products/>
				     	</div>
			     	</div>
			     	</div>

			     	<div className='container-fluid' >
			     		<BannerSub/>
			     	</div>
		     	</div>

		     	<FooterNewsletter/>
		     	<Footer />
		    </div>
		)
	}
}



